SUSCRÍBETE X $900
/ MES

 .indicators-board2-container{ display:none; } 

#header_new .top-contenedor .topbar .cliente #suscribase-header,
#header_new .top-contenedor .topbar3 .cliente #suscribase-header,
#header_new .top-contenedor .content-sections .suscribase-header {
background: #FF691A !important;
/*AQUI SE CAMBIA DE COLOR DEL BOTON, SIN OMITIR EL !important*/
color: #fff;
}
#header_new .top-contenedor .topbar .cliente #suscribase-header span,
#header_new .top-contenedor .top_bar .cliente #suscribase-header .suscribase,
#header_new .top-contenedor .top_bar .cliente #suscribase-header .suscribase .texto-light,
#header_new .top-contenedor .content-sections .suscribase-header .suscribase,
#header_new .top-contenedor .content-sections .suscribase-header .texto-light {
color: inherit;
}
@media screen and (max-width: 768px) {
header .header_mobile.stickyMobile .header_modulo_suscripcion p a[href*="suscripcion-digital"].btn_suscribirme {
color: #fff !important;
}
.m-registro-login .btn_subscription {
font-size: 0;
background: #FF691A;
color: #fff;
}
}
header .header_mobile .header_modulo_suscripcion a[href*="suscripcion-digital"].btn_suscribirme {
background: #FF691A !important;
/*AQUI SE CAMBIA DE COLOR DEL BOTON, SIN OMITIR EL !important*/
color: #fff !important;
}
header .header_mobile .header_modulo_suscripcion a[href*="suscripcion-digital"].btn_suscribirme .texto-light {
color: #fff !important;
}
header .header_mobile .header_modulo_suscripcion a[href*="suscripcion-digital"].btn_suscribirme .texto-light {
color: #fff
}
.m-registro-login .btn_subscription::before {
content: "suscribirme";
font-size: 15px;
}
#header_new .top-contenedor .content-sections #suscribase-header {
float: left;
height: 35px;
background: #FF691A;
font-size: .6875rem;
font-weight: normal;
line-height: 35px;
font-family: "open_sansbold", Arial, Helvetica, sans-serif;
color: #fff;
display: inline-block;
overflow-wrap: break-word;
word-wrap: break-word;
border-radius: 20px;
padding: 0 12px;
}

